import { React, Component } from 'react';



import './styles/Content.css';


class Content extends Component {
    constructor(props) {
        super(props);
    }
    render() {

      return (
        <div className='contents'>
            <h1>{this.props.cat}</h1>
        </div>
      ) 
    }
  }

  export default Content;
